import React , {useState}from "react";
import "../Styles/AddJob.css";
import Button from 'react-bootstrap/Button';
function AddJob() {
  const [jobData, setJobData] = useState(null);
  return (
    <div className="mainAddJobContainer">
      <div className="addjobs__Container">
        <h5>Add Job Details</h5>
        <div className="division" />

        <input placeholder="Add Company Name" />
        <input placeholder="Add Logo URL" />
        <input placeholder="Add Role" />
        <input placeholder="Add Description" />
        <input placeholder="Add Requirements" />
        <input placeholder="Add Compensations" />
        <input placeholder="Add Apply Link" />

        <Button variant="outline-primary" className="formSubmit">Submit</Button>
      </div>
    </div>
  );
}

export default AddJob;
